pragma solidity ^0.4.17;


contract CarrierDotInfo {

    // "dot census" -- dot licensing and insurance can be another contract

    address public managingContract;
    bytes32 public usDotNumber;
    bytes32 public dbaName;
    bytes32 public legalName;
    bytes32 public streetAddress;
    bytes32 public streetPhone;
    bytes32 public mailingAddress;
    bytes32 public mailingPhone;



    function CarrierDotInfo(
        bytes32 _usDotNumber,
        bytes32 _dbaName,
        bytes32 _legalName,
        bytes32 _streetAddress,
        bytes32 _streetPhone,
        bytes32 _mailingAddress,
        bytes32 _mailingPhone
    ) public 
    {
        managingContract = msg.sender;
        usDotNumber = _usDotNumber;
        dbaName = _dbaName;
        legalName = _legalName;
        streetAddress = _streetAddress;
        streetPhone = _streetPhone;
        mailingAddress = _mailingAddress;
        mailingPhone = _mailingPhone;
    }


    function getDotNumber() view public returns (bytes32) {
        return usDotNumber;
    }

}

